import React from "react";

export default () => {
  return (
    <div style={{ textAlign: "center", marginTop: "10%" }}>
      <h1>Hi, welcome to Monten!</h1>
      <h2>The best platform to help you manage your money</h2>
      <h3>Our platform allows you to: </h3>
      <h4>Easily view your spending by category through out the year </h4>
      <br />
      <h4>Easily view and re-categorise your transactions</h4> <br />
      <h4>Pay your bills online</h4> <br />
      <h4>Learn more about managing money and investing</h4> <br />
    </div>
  );
};
